import './App.css';
import React, {useState, useEffect} from 'react';
import Home from './pages';

function App() {
  const [count, setCount]= useState(0);

  useEffect(()=> {
    setTimeout(() => {
      document.title = `You aneesh clicked ${count} times`;
    },
    10000);

  })

  return (
    <div>
      <Home/>
    </div>
  );
}
export default App;
